    const router = useRouter();
    return (
        <div className={styles.Navbar}>
            <h1>Juliette van Rhyn</h1>
            <ul>
                <li className={router.pathname == "/" ? st : ""}>
                    <Link href="/"><a>Print design</a></Link>
                </li>
                <li className={router.pathname == "/graphic-design" ? "active" : ""}>
                    <Link href="/graphic-design"><a>Graphic design</a></Link>
                </li>
                <li className={router.pathname == "/about" ? "active" : ""}>
                    <Link href="/about"><a>About</a></Link>
                </li>
            </ul>
        </div>
    )
};

